import React, {useState} from 'react';
import { Menu } from 'antd';
import { 
  PlusSquareOutlined,
  ClockCircleOutlined, 
  SettingOutlined }
from '@ant-design/icons';
import { Input} from 'antd';
import './Navbar.css';

const {SubMenu} = Menu;
const { Search } = Input;



const onSearch = (value) => {

}
const handleClick = () => {
//
}

const Navbar = () => {
  const [current,setCurrent]= useState('');
  return (
    <Menu onClick={handleClick} selectedKeys={[current]}
     mode="horizontal"  >
        <Menu.Item key='mail' icon={<PlusSquareOutlined />} className="a"/>
        <Menu.Item key='mail' icon={<ClockCircleOutlined />} className=""b/>
        <Search style={{width:"300px", height: "20px",padding:"10px",margin:"10px"}} placeholder="input search text" onSearch={onSearch} enterButton className='search' />

        <SubMenu
        key='subMenu'
        disable icon={<SettingOutlined/>}
        >

        </SubMenu>
        </Menu>
  )
}

export default Navbar;




